import React from "react";

function PhoneItem({phone, remove}) {

    function removePhone() {
        remove(phone);
    }

    return (
        <div className="phone__item">
            <p>{phone.model}</p>
            {console.log("phone")}
            <button onClick={() => removePhone()}>Delete</button>
        </div>
    );
}

export default PhoneItem;
